import React, { useState } from "react";
import "./Contact.css";
import ContactLinks from "./ContactLinks";

export default function Contact() {
  return (
    <section id="contact">
      <h2>Contact me</h2>
      <p>You can reach me through the following platforms:</p>
      <ContactLinks />
    </section>
  );
}
